import React from 'react';
import './QuestionSummaryItem.css';

const questionSummaryItem = props => {
    const item = props.questionSummaryItem;
    return (
        <div className="QuestionItem">
            <div className="QuestionItemText"><p>{item.question}</p></div>
            <div className="QuestionItemAnswers"><p>{item.answers}</p></div>
        </div>
    );
};

export default questionSummaryItem;
